// Footer Animation
document.addEventListener("DOMContentLoaded", () => {

    $('[popup-open]').on('click', function () {
        $('.testimonial_pop_wrap').addClass('is-open');
    });

    $('[popup-close]').on('click', function () {
        $('.testimonial_pop_wrap').removeClass('is-open');
    });


    const r = document.querySelector(".lp_works_section");
    const navComponent = document.querySelector(".lp_nav_component");
    window.addEventListener("scroll", (() => {
        if (!r) return;
        const t = r.getBoundingClientRect(),
            o = t.top <= 0 && t.bottom > 0;
        r.classList.toggle("theme-dark", o);
        if (navComponent) {
            navComponent.classList.toggle("theme-dark", o);
        }
    }));

    const footer = document.querySelector(".footer_component");
    if (!footer) return;

    gsap.fromTo(footer,
        { y: "100%" },
        {
            y: "0%",
            ease: "none",
            scrollTrigger: {
                trigger: ".main-wrapper",
                start: "bottom bottom",
                end: "bottom 70%",
                scrub: true,
            }
        }
    );
});

